// import { render } from "@testing-library/react";

function App() {
  const numbers = [1,2,3,4,5];
  const lists=[
    {id:1, value : "Rojina"},
    {id:2, value : "Abc"}
  ];
  const num = numbers.map((item) => <li>{item*2}</li>);
  const listItems = lists.map((list) => 
              <div key = {list.id}>
              <h3>{list.value}</h3>
              </div>
);
  return(
    <ul>{num}
    {listItems}
    </ul>

  )

}

export default App;
